<main id="primary" class="site-main">
            <section id='' class='c-background_banner background_banner-default xenia-custom-background text-center no-margin no-padding border-radius-default' style='background-image:url(/img/tl.png);height:490px;;' data-layout='background_banner' data-position='1'>
                <div class='c-overlay'></div>
                <div class="container">
                    <div class="c-content__inner">
                        <h2 class='component-title h1' data-aos='fade-up' data-aos-duration='200'>Trị liệu toàn diện</h2>
                        <div class="c-content__copy">
                            <p>Liệu pháp thú y toàn diện kết hợp những gì tốt nhất của y học hiện đại với trí tuệ cổ xưa về chữa bệnh tự nhiên để cung cấp một cách tiếp cận toàn diện đối với việc chăm sóc thú cưng.</p>
                        </div>
                    </div>
                </div>
            </section>
            <section id='' class='c-content_column content_column-default component-custom-color text-center mt-1x px-1x border-radius-top skew_top' style='background-color:#faf7f1;color:#000000;' data-layout='content_column' data-position='2'>
                <div class="c-content-column">
                    <div class="container">
                        <div class="row">
                            <div class="col-12 col-sm-12 col-lg-12 col-xl-12">
                                <div class="c-content__inner c-content__center">
                                    <h2 class='component-title h2' style='color: #0d2554' data-aos='fade-up' data-aos-duration='200'>Chăm sóc thú cưng tích hợp</h2>
                                </div>
                            </div>
                        </div>
                        <div class="row">
                            <div class="col-12 col-sm-12 col-lg-6 col-xl-6">
                                <div class="c-content__inner">
                                    <div class="c-content__copy">
                                        <p style="text-align: left;">Bản thân là những người yêu thú cưng, chúng tôi hiểu tầm quan trọng của việc điều trị cho động vật, từ tâm trí, cơ thể và tinh thần của chúng đều được nuôi dưỡng và hỗ trợ.</p>
                                        <p style="text-align: left;">Đội ngũ của chúng tôi cung cấp một phương pháp tiếp cận tích hợp để chăm sóc thú cưng, kết hợp những gì tốt nhất của thuốc thông thường với các liệu pháp tổng thể tự nhiên. Chúng tôi tự hào về khả năng giúp thú cưng của bạn phát triển và phạm vi dịch vụ toàn diện của chúng tôi bao gồm châm cứu, trị liệu bằng laser và vật lý trị liệu, phục vụ cho sức khỏe thể chất và tinh thần của chúng.</p>
                                    </div>
                                </div>
                            </div>
                            <div class="col-12 col-sm-12 col-lg-6 col-xl-6">
                                <div class="c-content__inner">
                                    <div class="c-content__copy">
                                        <p style="text-align: left;">Bắt tay vào hành trình chăm sóc sức khỏe cho thú cưng của bạn bằng các kỹ thuật giải quyết các mối lo ngại như đau mãn tính, các vấn đề về vận động, lo lắng và các thách thức về hành vi.</p>
                                        <p style="text-align: left;">Chúng tôi dành thời gian để hiểu nhu cầu riêng của thú cưng của bạn và hợp tác với bạn để phát triển một kế hoạch điều trị tùy chỉnh phù hợp với yêu cầu cụ thể của chúng. Trải nghiệm những lợi ích biến đổi của liệu pháp toàn diện và để chúng tôi giúp thú cưng của bạn đạt được một cuộc sống hạnh phúc, khỏe mạnh và tràn đầy sức sống.</p>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </section>
